import React from 'react';
import './Person.css'
const person = (props) => {

    return (
        <div className="Person">
            <p onClick={props.delete}>I'm {props.name}, and my age is {props.age}</p>
            <p>{props.children}</p>
            <input type="text" onChange={props.changed} value={props.name}/>
        </div>
    );
}

export default person;
